import styled from 'styled-components';

export const Div = styled.div`
  display: flex;
  width: 100%;
  height: 100%;
`;

export const Content = styled.div`
  width: 82%;
  height: auto;
  display: flex;
  justify-content: center;
  padding: 4rem 10rem;

  margin-left: 18%;

  background-color: yellow;
`;

export const Wrapper = styled.div`
  width: 100%;
  height: 100%;
`;
